import React from 'react';
import "./Popup.css";
import fileloader from "../Assets/Pics/Fileloader.svg";
import canel from "../Assets/Pics/cancel 1.svg"
const Popup = ({ onClose }) => {
  return (
    <div className="popup-container">
      <div className="popup-content">
       <div style={{display:"flex", justifyContent:"space-between"}}>
       <div><img src={fileloader} alt="file loader" />
        </div>
       <div  >      
        <img style={{cursor:"pointer"}} src={canel} alt="cancel" onClick={onClose}/>
       </div>    
       </div>
      <div>
      <h1 className='font-bold text-xl mt-8 mb-2 l-0 '>Documents to Keep In Handy!</h1>
        <ol>
          <li>Document 1</li>
          <li>Document 2</li>
          <li>Document 3</li>
        </ol>
      </div>
        <button style={{width:"300px"}} onClick={onClose} className="mt-8 bg-red-500 text-white py-2 px-4 rounded">Continue</button>

      </div>
    </div>
  );
};

export default Popup;
